import { Grid, Input, Paper, Typography } from "@mui/material";
import React from "react";

const Add = () => {
  return (
    <div>
      <Grid container textAlign="center">
        <Typography variant="h5" width={100}>Add A New Product</Typography>

        <Paper>
          <Grid item>
            <Input></Input>
          </Grid>
        </Paper>
      </Grid>
    </div>
  );
};

export default Add;
